describe("Check for Paper Creation",function(){it("creates simple paper 20 × 10",function(){var e=Snap(20,10),t=e.node;expect(t).to.not.be(null);expect(t.getAttribute("width")).to.be("20");expect(t.getAttribute("height")).to.be("10");e.remove()});it("removal of paper",function(){var e=Snap(20,10),t=e.node;expect(t).to.not.be(null);e.remove();t=document.querySelectorAll("svg").length;expect(t).to.be(1)});it("creates simple paper 20% × 10em",function(){var e=Snap("20%","10em"),t=e.node;expect(t).to.not.be(null);expect(t.getAttribute("width")).to.be("20%");expect(t.getAttribute("height")).to.be("10em");e.remove()});it("converts existing SVG element to paper",function(){var e=document.getElementById("svgroot"),t=Snap(e);expect(document.querySelector("#svgroot circle")).to.be(null);var n=t.circle(10,20,5);expect(document.querySelectorAll("#svgroot circle").length).to.be(1);n.remove()});it("converts existing SVG element to paper (as query)",function(){var e=document.getElementById("svgroot"),t=Snap("#svgroot");expect(document.querySelector("#svgroot circle")).to.be(null);var n=t.circle(10,20,5);expect(document.querySelectorAll("#svgroot circle").length).to.be(1);n.remove()})});describe("Paper methods",function(){var e;beforeEach(function(){e=Snap(100,100)});afterEach(function(){e.remove()});it("Paper.svg",function(){var t=e.svg();expect(t.node.nodeName).to.be("svg");expect(t.node.parentNode).to.be(e.node)});it("Paper.svg(x, y)",function(){var t=e.svg(100,200);expect(t.node.nodeName).to.be("svg");expect(t.node.x.baseVal.value).to.be(100);expect(t.node.y.baseVal.value).to.be(200);expect(t.node.parentNode).to.be(e.node)});it("Paper.svg(x, y, w, h, viewbox)",function(){var t=e.svg(100,200,300,400,10,20,30,40);expect(t.node.nodeName).to.be("svg");expect(t.node.x.baseVal.value).to.be(100);expect(t.node.y.baseVal.value).to.be(200);expect(t.node.width.baseVal.value).to.be(300);expect(t.node.height.baseVal.value).to.be(400);expect(t.node.getAttribute("viewBox")).to.be("10 20 30 40");expect(t.node.parentNode).to.be(e.node)});it("Paper.el",function(){var t=e.el("circle");expect(t.node.nodeName).to.be("circle");expect(t.node.parentNode).to.be(e.node)});it("Paper.filter",function(){var t=e.filter('<feGaussianBlur stdDeviation="2"/>');expect(t.node.nodeName).to.be("filter");var n=t.node.firstChild;expect(n).to.be.ok();expect(n.nodeName).to.be("feGaussianBlur");expect(n.getAttribute("stdDeviation")).to.be("2")});it("Paper.gradient - linear",function(){var t=e.gradient("l(0, 0, 1, 1)#000-#f00-#fff");expect(t.node.nodeName).to.be("linearGradient");expect(t.node.getAttribute("x1")).to.be("0");expect(t.node.getAttribute("y1")).to.be("0");expect(t.node.getAttribute("x2")).to.be("1");expect(t.node.getAttribute("y2")).to.be("1");var n=t.node.querySelectorAll("stop");expect(n.length).to.be(3)});it("Paper.gradient - radial",function(){var t=e.gradient("r(0.3, 0.4, 0.5)#000-#fff");expect(t.node.nodeName).to.be("radialGradient");expect(t.node.getAttribute("cx")).to.be("0.3");expect(t.node.getAttribute("cy")).to.be("0.4");expect(t.node.getAttribute("r")).to.be("0.5");var n=t.node.querySelectorAll("stop");expect(n.length).to.be(2)});it("Paper.image",function(){var t=e.image("#",10,20,30,40),n=document.querySelector("image");expect(n).to.not.be(null);expect(n.getAttribute("x")).to.be("10");expect(n.getAttribute("y")).to.be("20");expect(n.getAttribute("width")).to.be("30");expect(n.getAttribute("height")).to.be("40")});it("Paper.toString",function(){e.circle(10,20,30);var t=e.toString();expect(t).to.match(/.*?<svg.*?>.*?<circle.*?<\/svg>/)});it("Paper.getBBox",function(){e.circle(50,50,30);var t=e.getBBox();expect(t.x).to.be(20);expect(t.y).to.be(20);expect(t.width).to.be(60);expect(t.height).to.be(60)})});